import React, { Component, Fragment} from 'react'
import Link from 'next/link'

import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import FormControlLabel from '@material-ui/core/FormControlLabel'
import Checkbox from '@material-ui/core/Checkbox'

import FavoriteIcon from '@material-ui/icons/Favorite'
import FavoriteBorderIcon from '@material-ui/icons/FavoriteBorder'
import AddIcon from '@material-ui/icons/Add';
import CreditCardIcon from '@material-ui/icons/CreditCard';


class fridgeMagnets extends Component {

  constructor(props)
  {
    super(props)
  }

  render() {

    return (
      <div className="frige">

        <style jsx>
          {`
            .frige{
              background-image: url("fridge.svg");
              background-repeat: no-repeat;
              background-attachment: fixed;
              background-position: center center;
              background-size: contain;
            }

            .sideButton{
              position: absolute;
              display: flex;
              align-items: center;
              justify-content: center;
            }

            .right{
              right: 0;
              height: 50%;
              width: 40px; 
            }

            .left{
              background: gainsboro;
              left: 0;
              height: 100%;
              width: 40px; 
              top: 0;
              border-top-left-radius: 15px;
              border-bottom-left-radius: 15px;
            }

            .top{
              background: gainsboro;
              border-top-right-radius: 15px;
              top: 0;
            }

            .bottom{
              background: lightgrey;
              border-bottom-right-radius: 15px;
              bottom: 0;
            }

            .butchery{

            }

            .pharmacy{

            }

            .bakery{

            }

            .vegetableStore{

            }

            .liquorStore{

            }

            .petStore{

            }

            .hardwareStore{

            }

            .reastaurant{

            }

            .fastFoodRestaurant{

            }

            .groceryStore{

            }

            .stationeryStore{

            }

            .store{

            }
          `}
        </style>

        <Grid container justify="center" alignItems="baseline">
          {(
          this.props.stores==null
            ?""
            :this.props.stores.map((store) => (
              <Paper elevation={3} style={{width:"200px", margin:"5px", paddingLeft:"45px", paddingRight:"45px", paddingTop:"0", paddingBottom:"0", position:'relative', borderRadius:'15px'}}>
                <div className="sideButton left">
                  <AddIcon color=""/> 
                </div>
                <div>
                  <p>
                    <strong>{store.name}</strong>
                    <br></br>
                    <small>{(store.type!=null?store.type:"Tienda")}{(store.aceptsCards?" - "+<CreditCardIcon color=""/>+" Acepta Tarjetas":"")} </small>
                    <br></br>
                    <small>{store.address}</small>
                  </p>
                  <p>

                  </p>
                </div>
                <div className="sideButton right top">
                  <FormControlLabel
                      style={{marginRight:"-10px"}}
                      control={
                      <Checkbox 
                        icon={<FavoriteBorderIcon />} 
                        checkedIcon={<FavoriteIcon />} 
                        name="checkedH" 
                      />
                    }
                  />
                </div>
                <Link href="/about">
                  <div className="sideButton right bottom">
                    <AddIcon color=""/> 
                  </div>
                </Link>
              </Paper>
            ))
          )}
        </Grid>
      </div>
    )
  }
}

export default fridgeMagnets;
